I found that if JSComponent has a parameter in constructor(any type, any name, it doesn't really matter), then functions like `start`, `update` wouldn't work.
Here's an example of TypeScript code:

``` TypeScript
/// <reference path="../Atomic.d.ts" />

class Star extends Atomic.JSComponent {

    constructor(okLetsBreakEverything:any) {
        super();
    }

    start() {
        console.log("ok, start didn't work");
    }

    update(time:number) {
        console.log("update didn't work too :(");
    }

}

export = Star;
```

The same thing with haxe.
